import React from "react";
import "../stylesheets/animation.css";

const animation = (props) => {
  return (
    <div
      className={
        props.popOut === 1
          ? "ANOuterDiv popOutRight"
          : props.popOut > 1
          ? "ANOuterDiv Remove"
          : "ANOuterDiv"
      }
    >
      <iframe
        className="Animation"
        id="HomeAnimation"
        src="home/index.html"
        height="650px"
        width="800px"
        frameBorder="0"
      ></iframe>
    </div>
  );
};

export default animation;
